import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { useHistory } from "react-router";
import { allCountries, getCountries, _order } from "../../f_redux/f_actions/actions";
import img from "../../f_img/Mundo_hecho_de_Banderas-gif.gif";
import { Link } from "react-router-dom";
require("../f_principal/principal.css")

export default function Principal() {
  const dispatch = useDispatch();
  const history = useHistory();
  useEffect(() => {
    dispatch(allCountries());
    dispatch(getCountries());
   
  }, []);

  return (
    <div className="divPrincipal">
      <Link to="/home" >
      <img
        className="button-ingresar"
        src={img} alt=""
      />



      </Link>
      <h4 className="h4">BIENVENIDO</h4>
    </div>
  );
}
